import { useState } from "react";
import { Link } from "react-router-dom";
const Homepage = () => {

  return(
    <>
      <p className="emphasised">Control Panel</p>
      <h1 className="emphasised">Frontend Developer</h1>
      <a href="/contact">Contact Me</a>
      <Link className="nav-link" to="/contact"><StyledNavLink $isPrimary={false}>Contact</StyledNavLink></Link>

    </>
  );
}

export default Homepage;
